def test_single(ip, port):
    try:
        checker_url = 'http://api.proxyipchecker.com/pchk.php'
        values = {"ip" : ip,
                "port" : port,
                "bw" : "1"}
        data = urllib.urlencode(values)
        req = urllib2.Request(checker_url, data)
        url = urllib2.urlopen(req)
        result = url.read()
        result_arr = result.split(';')
        record = {}
        record['rslt'] = result
        record['chk'] = datetime.datetime.now().strftime('%Y-%m-%d %H:%M:%S')
        record['adr'] = ip + ':' + port
        record['ip'] = ip
        record['port'] = port
        record['rsp'] = result_arr[0]
        record['spd'] = result_arr[1]
        record['country'] = result_arr[2]
        if result_arr[3] == '1':
            record['type'] = 'T'
        elif result_arr[3] == '2':
            record['type'] = 'A'
        elif result_arr[3] == '3':
            record['type'] = 'HA'
        else:
            record['type'] = 'U'
        scraperwiki.sqlite.save(['adr'], record)
    except:
        return ''


def test_all():
    data = scraperwiki.sqlite.select("* from swdata where ifnull(rsp, '') = ''")
    for d in data:
        test_single(d['ip'], d['port'])

